export default function Board() {

    function handleClickEvent(tile) {
        let position = tile.getAttribute("data-position")
        let img = document.createElement("img");
        img.src="x.png"
        tile.appendChild(img)

        console.log("you clicked " + position)
    }
    return (
        <>
         <h1>Tic-Tac-Toe</h1>
            <button className="square">X</button>
                <div className="game-board">
                    <div className="box" data-position="0" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="1" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="2" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="3" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="4" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="5" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="6" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="7" onClick={handleClickEvent(this)}></div>
                    <div className="box" data-position="8" onClick={handleClickEvent(this)}></div>
                </div>

        </>
    )     
  }
